import React from "react";

const List = (props) => {
  console.log(props.textData);
  const newTextObject = props.textData;
  return (
    <div>
      <ul>
        <li style={{ color: props.textColor }}>React</li>
        <li style={{ color: props.textColor }}>{newTextObject}</li>
        <li style={{ color: props.textColor }}>Js</li>
        <li style={{ color: props.textColor }}>Redux</li>
      </ul>
    </div>
  );
};

export default List;
